MiniProject.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract mini_project {
    address public owner;
    address public new_owner;
    uint256 public amount;

    string public message = "Welcome";

    constructor() {
        owner = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
    }

    enum Status {
        Ordered,
        Pending,
        Shipped,
        Delivered
    }

    modifier only_owner() {
        require(owner == msg.sender, "Not Owner");
        _;
    }
    modifier balance_checker() {
        require(amount >= 1 ether, "Insufficient Balance");
        _;
    }
    modifier status_limit() {
        require(
            uint256(status) <= uint256(type(Status).max),
            "Already Delivered"
        );
        _;
    }

    Status status;
    event Status_set(string mymsg);

    function get_status() public view returns (Status) {

            return status;

    }

    function set_status(Status x)
        public
        only_owner
        status_limit
        returns (string memory)
    {
        status = x;
        if (status == Status.Shipped) {
            emit Status_set("Shipped");
            message = "Shipped";
            return message;
        } else if (status == Status.Delivered) {
            emit Status_set("Deliverd");
            message = "Delivered";
            return message;
        } else {
            emit Status_set("pending");
            message = "pending";
            return message;
        }
    }

    function Get_amount() public payable {}

    function update_balance() public returns (uint256) {
        amount = address(this).balance;
        return amount;
    }

    function Owner_ship() public only_owner balance_checker {
        if (amount >= 1 ether) {
            new_owner = 0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB;
            status = Status.Pending;
            message = "Order Has Been Placed Successfully";
        }
    }
}

